import React from 'react';
import axios from 'axios';

function Index(props) {
  //console.log(props);
  return <div>Hello</div>;
}

Index.getInitialProps = () => {
  const res = axios
    .get('https://rickandmortyapi.com/api/character')
    .then((res) => console.log(res.data));

  // console.log(data);

  console.log(res);

  return {};
};

export default Index;
